import styled from 'styled-components';

export const Container = styled.header`
  background: var(--blue);
  display: flex;
  align-items: center;
`;

export const Content = styled.div`
  max-width: 1128px;
  max-height: 37vh;
  margin: 0 auto;
  display: flex;
  justify-content: center;
`;

export const logo = styled.img`
  width: 244px;
  height: 64.11px;
`;
